  true,\n\t\"url\": null,\n\t\"notes\": \"<p>On September 22, 2010, Abbott issued
  a voluntary recall of certain Similac powdered infant formula after identifying
  a common warehouse beetle (both larvae and adults) in the finished product at their
  Sturgis, Michigan plant. The company immediately put all product manufactured at
  the Michigan plant on hold and ceased manufacturing at that location. FDA has advised
  against consumption of the recalled product and urged consumers to follow the manufacturer's
  instructions for reporting and returning the formula.</p>n\",\n\t\"license_title\":
